import React, { Component } from 'react';
import {table} from "antd"

class Record extends Component {
  render() {
    return (
       <tr>
           <td>2018-10-1</td>
           <td>买衣服</td>
           <td>1000</td>
       </tr>
    );
  }
}

export default Record;
